// src/components/Donate.js
import React, { useState } from "react";
import axios from "axios";

export default function Donate({ token }) {
  const [foodType, setFoodType] = useState("cooked");
  const [quantity, setQuantity] = useState("");
  const [instructions, setInstructions] = useState("");
  const [assignedNgo, setAssignedNgo] = useState(null);
  const [msg, setMsg] = useState("");
  const [loading, setLoading] = useState(false);

  async function submitDonation(e) {
    e.preventDefault();
    setMsg("");
    setAssignedNgo(null);

    if (!quantity || isNaN(quantity)) {
      setMsg("Please enter a valid quantity.");
      return;
    }

    setLoading(true);

    // Get user location
    navigator.geolocation.getCurrentPosition(
      async (pos) => {
        try {
          const res = await axios.post(
            "http://localhost:5000/api/rescue/donate",
            {
              // baseline fields
              foodType,
              quantity: Number(quantity),

              // backend expects direct fields, NOT an object
              pickupLat: pos.coords.latitude,
              pickupLng: pos.coords.longitude,

              pickupInstructions: instructions
            },
            {
              headers: {
                Authorization: `Bearer ${token}`
              }
            }
          );

          // backend responses:
          // Assigned → includes assignedNgo
          // Pending → includes message + donation
          setMsg(res.data.message || "Donation submitted.");

          if (res.data.assignedNgo) {
            setAssignedNgo(res.data.assignedNgo);
          } else {
            setAssignedNgo(null);
          }
        } catch (err) {
          console.error(err);
          setMsg("Donation failed");
        } finally {
          setLoading(false);
        }
      },
      () => {
        setMsg("Please enable location access to donate food.");
        setLoading(false);
      }
    );
  }

  return (
    <div className="page-container">
      <h1 className="page-title">Donate Surplus Food</h1>

      {msg && <div className="alert" style={{ marginBottom: 12 }}>{msg}</div>}

      <form className="card" onSubmit={submitDonation}>
        <label>Food Type</label>
        <select
          value={foodType}
          onChange={(e) => setFoodType(e.target.value)}
        >
          <option value="cooked">Cooked</option>
          <option value="packaged">Packaged</option>
        </select>

        <label style={{ marginTop: 10 }}>Quantity (kg)</label>
        <input
          value={quantity}
          onChange={(e) => setQuantity(e.target.value)}
          type="number"
          placeholder="e.g., 5"
        />

        <label style={{ marginTop: 10 }}>Pickup Instructions</label>
        <textarea
          value={instructions}
          onChange={(e) => setInstructions(e.target.value)}
          placeholder="e.g., Back gate, call manager at arrival"
        />

        <button
          className="primary-btn"
          style={{ marginTop: 14 }}
          disabled={loading}
        >
          {loading ? "Submitting..." : "Donate"}
        </button>
      </form>

      {assignedNgo && (
        <div className="card" style={{ marginTop: 16 }}>
          <h3>Assigned NGO</h3>
          <p><b>Name:</b> {assignedNgo.name}</p>
          <p><b>Phone:</b> {assignedNgo.contact?.phone || "N/A"}</p>
          <p><b>Address:</b> {assignedNgo.address || "N/A"}</p>
          <p><b>Remaining Capacity:</b> {assignedNgo.remainingCapacity}</p>
        </div>
      )}
    </div>
  );
}
